import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.bundle.min.js"; // for dropdowns and other JS components
import Header from "./components/Header";
import Posts from "./components/Posts";
import Page from './Page'; // Import the Page component

const App = () => {
  return (
    <Router>
      <Header />
      <Routes>
      <Route exact path="/" render={() => <Page slug="home" />} />
      <Route path="/" element={<h1>Welcome to Headless WordPress</h1>} />
        <Route path="/posts" element={<Posts />} />
      </Routes>
      <Posts/>
    </Router>
  );
};

export default App;
